import "./App.css"
const App = () => {
    const delt = () => {};
    const add = () => {};
    return (
        <>
            <div className="todoList">
                <h1 className="heading">todo list</h1>
                <div className='inputFiled'>
                    <input placeholder='this is input field' /><button onClick={add}>Botton</button>
                </div>
                <ul className='uoList'>
                    <div className=''><button className='btn' onClick={delt}>botton</button><li className='list'>this is todo_list</li></div>
                    <div className=''><button className='btn' onClick={delt}>botton</button><li className='list'>this is todo_list</li></div>
                    <div className=''><button className='btn' onClick={delt}>botton</button><li className='list'>this is todo_list</li></div>
                </ul>
            </div>
        </>
    );
}

export default App;
